import React, { Component } from 'react';
import getSports from './actions/sportsActions';

class SportsContainer extends Component {
  componentDidMount() {

    getSports()
  }

  render(){
    return(
      <div>Sports getSports{getSports}

      </div>
    )
  }
}
export default SportsContainer;
